import React from 'react'; // Import the Component component from React

import ProjectHeader from './../projectPage/ProjectHeader.js'
import HeroImage from './../projectPage/HeroImage.js'
import SectionOne from './../projectPage/SectionOne.js'
import Image from './../projectPage/Image.js'

import Divider from './../projectPage/Divider.js';


const data = {
  'heroImage':require('./../../content/projects/beatbox/hero-image.png'),
}

const a = {
  'title':'',
  'text':'',
  'image':require('./../../content/projects/beatbox/1.png'),
}



function Beatbox(props) {
    return(
      <div>
        <ProjectHeader
         projectKey='bigData'
        />
        <HeroImage
         heroImage={data.heroImage}
        />
        <Divider/>
        <SectionOne
         title={a.title}
         text={a.text}
         image={a.image}
        />
        <Divider/>
        <SectionOne
         title={b.title}
         text={b.text}
         image={b.image}
        />
      </div>
    )
}

export default Beatbox;
